          "synopsis": "Departing from their respective hometowns, two young women with identical names are brought together in their pursuit of new beginnings. With their hearts set on going to Tokyo, Nana Komatsu dreams about blissful love, while Nana Osaki aims for a successful music career.\n\nThe former has a cheerful and friendly nature, but her naivety has steered her romantic life astray until she meets her dependable boyfriend—Shouji Endo. Without letting herself be dismayed by Shouji's decision to study in Tokyo, Nana works hard to earn enough money and follow him there. Meanwhile, her namesake is a solitary punk vocalist whose impassioned romance with her band's bassist, Ren Honjou, comes to a sudden end. Though heartbroken, Nana bravely looks forward and travels to the capital with the ambition of becoming a recognized artist.\n\nShortly after they arrive in Tokyo, the girls cross paths again due to an unexpected coincidence that ultimately leads them to live under the same roof. As they grow closer, the two strive to support one another amid their struggles to forge a future for themselves.\n\n[Written by MAL Rewrite]",
          "background": "After the release of the first episode on April 5, 2006, Nana's highest TV rating was 6.3% in the Kanto region, making it the first late-night anime to reach the top 10 of the weekly audience ranking. In Japan, VAP published 17 DVDs of the series between July 7, 2006 and November 21, 2007. In North America, four DVD box sets were released by Viz Media from September 2009 to April 2010. The company also released an English dub version, which premiered on the Funimation Channel on September 19, 2009. Sentai Filmworks licensed the series in 2021 after Viz Media lost its rights. Nana inspired a couple of tribute albums, the most notable of them being \"Love for Nana - Only 1 Tribute,\" which was released by EMI Music Japan on March 16, 2005.",
