          "synopsis": "Maquia is a member of a special race called the Iorph—mystical beings who can live for hundreds of years and remain separate from the lives and daily troubles of mankind. However, Maquia has always felt lonely despite being surrounded by her people, as she was orphaned from a young age. She daydreams about the outside world, but dares not travel from her home due to the warnings of the clan's chief.\n\nOne day however, the outside world finds her, as the power-hungry kingdom of Mezarte invades her homeland. They already have what is left of the giant dragons, the Renato, under their control, and now their king wishes to add the immortality of the Iorph to his bloodline.\n\nThe humans and their Renato ravage the Iorph homeland and kill most of its inhabitants. Caught in the midst of the attack, Maquia is carried off by one of the Renato that has gone berserk. It soon dies, and she is left deserted in a forest far from home, now truly alone save for the cries of a single baby off in the distance. Maquia finds the baby in a destroyed village and decides to raise him as her own, naming him Ariel. Although she knows nothing of the human world, how to raise a child that ages much faster than her, or how to live with the smoldering loneliness inside, she is determined to make it all work somehow.\n\n[Written by MAL Rewrite]",
          "background": "Sayonara no Asa ni Yakusoku no Hana wo Kazarou, abbreviated as SayoAsa, is the directorial debut of screenwriter Mari Okada. Outside of Japan, the film made its international premiere at the 2018 Glasgow Film Festival. It went on to receive the Golden Goblet Award for Best Animation Film at the 21st Shanghai International Film Festival, and was named Best Feature Length Film in the Fantastic Discovery section at the 51st Sitges Film Festival. The film has earned more than 350 million yen in domestic box office revenues.",
