          "synopsis": "Rama, the eldest prince of the Kingdom of Ayodhya, is beloved by all and the natural successor to his father's throne. However, when one of his father's wives conspires to get her son on the throne instead, Rama ends up being banished into the woods for 14 years. Accompanied by his wife, Sita, and his brother, Lakshman—Rama tries to make the most of life in exile despite his challenges.\n\nThe trio's life in the forest is interrupted, however, when Demon King Ravan sets his sights on Sita. Using a crafty plan, he manages to distract Rama and steal Sita away to his castle. Heartbroken and distraught, Rama searches every corner of the world for his wife, unaware of the lengths he will have to go to rescue her.\n\n[Written by MAL Rewrite]",
          "background": "Ramayana: The Legend of Prince Rama, a joint production between India and Japan, is based on the Indian epic Ramayana. The original English version with Sanskrit songs was worked on by teams from both countries and was screened for the first time at 24th International Film Festival of India, New Delhi, 1993. A 4K remastered version was launched in 2022, marking the 70th anniversary of India-Japan diplomatic relations.",
